package DSA.journey.Strings;

public class RabinKarp {

    public static void main(String[] args) {
        String a="";
        String b="a";
        System.out.println(new RabinKarp().solve(a,b));
    }
    public int solve(String t, String w) {
        int count=0;
        long mod=(long)Math.pow(10,9)+7;
        int n=t.length();
        int k=w.length();
        long fw=0;
        long ft=0;
        int p=31;
        long c=1;
        for(int i=0;i<k;i++){
            fw=((fw %mod+ ((long) w.charAt(i) *c)%mod) +mod)%mod;
            ft=((ft %mod+ ((long) t.charAt(i) *c)%mod) +mod)%mod;
            c=(c*31)%mod;

        }
        if(ft==fw)count++;
        int s=1;
        int e=k;
        long x=(int)Math.pow(p,s-1);
        long y=(int)Math.pow(p,e);
        while(e<n){
            ft=((ft-t.charAt(s-1)*x)%mod    + (t.charAt(e)*y)%mod    +mod)%mod;
            fw=((fw*p)%mod+mod)%mod;
            if(ft==fw)count++;
            s++;
            e++;
            x=(x*p)%mod;
//            if(x<0){
//                x=(x+mod)%mod;
//            }
            y=(y*p)%mod;
//            if(y<0){
//                y=(y+mod)%mod;
//            }
        }
        return count;

    }
}
